import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import ActivityForm from './ActivityForm';
import EmissionsChart from './EmissionsChart';
import OffsetSuggestions from './OffsetSuggestions';
import './Calculator.css';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const Calculator = () => {
  const navigate = useNavigate();
  const [activities, setActivities] = useState([]);
  const [totalEmissions, setTotalEmissions] = useState(0);
  const [loading, setLoading] = useState(false);
  const [activeTab, setActiveTab] = useState('commute');

  useEffect(() => {
    // Load saved activities from localStorage
    const saved = localStorage.getItem('carbonActivities');
    if (saved) {
      try {
        const parsed = JSON.parse(saved);
        setActivities(parsed);
        calculateTotal(parsed);
      } catch (error) {
        console.error('Error loading saved activities:', error);
      }
    }
  }, []);

  const calculateTotal = (activitiesList) => {
    const total = activitiesList.reduce((sum, activity) => {
      return sum + (activity.co2e || 0);
    }, 0);
    setTotalEmissions(total);
  };

  const handleActivitySubmit = async (activityData) => {
    setLoading(true);
    try {
      let response;
      
      switch (activityData.type) {
        case 'commute':
          response = await axios.post(`${API_BASE_URL}/calculate/commute`, {
            distance: parseFloat(activityData.distance),
            vehicleType: activityData.vehicleType,
            unit: 'km'
          });
          break;
        case 'electricity':
          response = await axios.post(`${API_BASE_URL}/calculate/electricity`, {
            energy: parseFloat(activityData.energy),
            unit: 'kWh'
          });
          break;
        case 'food':
          response = await axios.post(`${API_BASE_URL}/calculate/food`, {
            foodType: activityData.foodType,
            quantity: parseFloat(activityData.quantity),
            unit: 'kg'
          });
          break;
        default:
          throw new Error('Invalid activity type');
      }

      if (response.data.success) {
        const newActivity = {
          id: Date.now(),
          type: activityData.type,
          date: new Date().toISOString().split('T')[0],
          ...response.data,
          ...activityData
        };

        const updatedActivities = [...activities, newActivity];
        setActivities(updatedActivities);
        calculateTotal(updatedActivities);
        localStorage.setItem('carbonActivities', JSON.stringify(updatedActivities));
      } else {
        alert('Error calculating emissions. Please try again.');
      }
    } catch (error) {
      console.error('Error calculating emissions:', error);
      alert('Error calculating emissions. Please check your API key and try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleDeleteActivity = (id) => {
    const updated = activities.filter(activity => activity.id !== id);
    setActivities(updated);
    calculateTotal(updated);
    localStorage.setItem('carbonActivities', JSON.stringify(updated));
  };

  const getActivitiesByType = (type) => {
    return activities.filter(activity => activity.type === type);
  };

  const getDailyEmissions = () => {
    const daily = {};
    activities.forEach(activity => {
      const date = activity.date;
      if (!daily[date]) {
        daily[date] = 0;
      }
      daily[date] += activity.co2e || 0;
    });
    return daily;
  };

  const getWeeklyEmissions = () => {
    const weekly = {};
    activities.forEach(activity => {
      const date = new Date(activity.date);
      const weekStart = new Date(date);
      weekStart.setDate(date.getDate() - date.getDay());
      const weekKey = weekStart.toISOString().split('T')[0];
      
      if (!weekly[weekKey]) {
        weekly[weekKey] = 0;
      }
      weekly[weekKey] += activity.co2e || 0;
    });
    return weekly;
  };

  return (
    <div className="calculator-page">
      <header className="calculator-header">
        <div className="header-content">
          <button className="back-button" onClick={() => navigate('/')}>
            ‚Üê Back to Home
          </button>
          <h1 className="calculator-title">Carbon Footprint Calculator</h1>
        </div>
      </header>

      <div className="calculator-container">
        {/* Total Emissions Card */}
        <div className="total-emissions-card">
          <div className="total-emissions-content">
            <h2>Total Carbon Footprint</h2>
            <div className="emission-value">
              <span className="emission-number">{totalEmissions.toFixed(2)}</span>
              <span className="emission-unit">kg CO‚ÇÇe</span>
            </div>
            <p className="emission-description">
              {totalEmissions === 0 
                ? 'Start tracking your activities to see your carbon footprint'
                : totalEmissions < 10
                ? 'Great job! You\'re keeping your footprint low.'
                : totalEmissions < 50
                ? 'Consider reducing your daily emissions.'
                : 'Your footprint is high. Check offset suggestions below.'}
            </p>
          </div>
        </div>

        {/* Tabs */}
        <div className="tabs-container">
          <button 
            className={`tab ${activeTab === 'commute' ? 'active' : ''}`}
            onClick={() => setActiveTab('commute')}
          >
            üöó Commute
          </button>
          <button 
            className={`tab ${activeTab === 'electricity' ? 'active' : ''}`}
            onClick={() => setActiveTab('electricity')}
          >
            ‚ö° Electricity
          </button>
          <button 
            className={`tab ${activeTab === 'food' ? 'active' : ''}`}
            onClick={() => setActiveTab('food')}
          >
            üçΩÔ∏è Food
          </button>
          <button 
            className={`tab ${activeTab === 'charts' ? 'active' : ''}`}
            onClick={() => setActiveTab('charts')}
          >
            üìä Charts
          </button>
          <button 
            className={`tab ${activeTab === 'offsets' ? 'active' : ''}`}
            onClick={() => setActiveTab('offsets')}
          >
            üå± Offsets
          </button>
        </div>

        {/* Tab Content */}
        <div className="tab-content">
          {activeTab !== 'charts' && activeTab !== 'offsets' && (
            <ActivityForm 
              type={activeTab} 
              onSubmit={handleActivitySubmit}
              loading={loading}
            />
          )}

          {activeTab === 'charts' && (
            <EmissionsChart 
              dailyEmissions={getDailyEmissions()}
              weeklyEmissions={getWeeklyEmissions()}
            />
          )}

          {activeTab === 'offsets' && (
            <OffsetSuggestions totalEmissions={totalEmissions} />
          )}

          {/* Recent Activities */}
          {activeTab !== 'charts' && activeTab !== 'offsets' && (
            <div className="recent-activities">
              <h3>Recent {activeTab.charAt(0).toUpperCase() + activeTab.slice(1)} Activities</h3>
              {getActivitiesByType(activeTab).length === 0 ? (
                <p className="no-activities">No activities recorded yet. Add one above!</p>
              ) : (
                <div className="activities-list">
                  {getActivitiesByType(activeTab).slice().reverse().map(activity => (
                    <div key={activity.id} className="activity-item">
                      <div className="activity-info">
                        <div className="activity-type">
                          {activity.type === 'commute' && `üöó ${activity.vehicleType} - ${activity.distance} km`}
                          {activity.type === 'electricity' && `‚ö° ${activity.energy} kWh`}
                          {activity.type === 'food' && `üçΩÔ∏è ${activity.foodType} - ${activity.quantity} kg`}
                        </div>
                        <div className="activity-date">{activity.date}</div>
                      </div>
                      <div className="activity-emission">
                        <span className="emission-amount">{activity.co2e?.toFixed(2)}</span>
                        <span className="emission-unit-small">kg CO‚ÇÇe</span>
                        <button 
                          className="delete-button"
                          onClick={() => handleDeleteActivity(activity.id)}
                          aria-label="Delete activity"
                        >
                          √ó
                        </button>
                      </div>
                    </div>
                  ))}
                </div>
              )}
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Calculator;
